import React from 'react';

export default class Incarceration{
    render(){
        return(
            <div>
                <form>
                    <label for="fname">Nom:</label>
                    <input type="text" id="lastname" name="fname" placeholder="Ex: Dupont"></input>
                    <label for="lname">Prenom:</label>
                    <input type="text" id="firstname" name="lname" placeholder="Ex: Marcel"></input>
                    <button value="Ajouter" onClick={() => console.log('ajouter')}></button>
                </form>
            </div>
        );
    }
}
